      <Grid container spacing={2} sx={{justifyContent:'center'}}>
        <Grid item >
        <Paper
        sx={{
            p: 2,
            margin: 'auto',
            width: 300,
            height:250,
            flexGrow: 1,
            backgroundColor: (theme) =>
            theme.palette.mode === 'dark' ? '#1A2027' : '#f2f3f5',
        }}
        >
        <Grid container spacing={2}>
            <Grid item sx={{width:'100%', height:'300px'}}>
                <div style={{display:'flex'}}>
                    <InfoRoundedIcon />
                </div>
                <div style={{width:'100%', fontWeight:'bolder', fontSize:28}}>
                    <p style={{margin:0}}>MetaParser</p>
                </div>
                <div style={{display:'flex', marginTop:160, justifyContent:'right'}}>
