            <Grid item sx={{width:'100%', height:'300px'}}>
                <div style={{display:'flex'}}>
                    <InfoRoundedIcon />
                </div>
                <div style={{width:'100%', fontWeight:'bolder', fontSize:28}}>
                    <p style={{margin:0}}>MetaParser</p>
                </div>
                <div style={{display:'flex', marginTop:160, justifyContent:'right'}}>
                    <Button variant="outlined">Launch</Button>
                </div>
            </Grid>
        </Grid>
        </Paper>
        </Grid>
    </Grid>
  );
}
